import React from 'react';
import { Link } from 'react-router-dom';
const Menu = () => {
  return (
    <>
      <Link>AboutUS</Link>
      <Link>ContactUS</Link>
      <a href="/">AboutUS</a>
      <a href="/contact">ContactUS</a>
    </>
  );
};

export default Menu;

// Instead of anchor tag, we use link in the React Router.
